pragma solidity ^0.8.0;

import "../../agnostic/Token/TokenLib.sol";

library Order {
    /////////////////////////////////////////////////////////////////////////////////////////
    //      MarketOrderState
    //          Unknown         Unknown state
    //          Active          Active Order
    //          Completed       Completed Order (all _qty fully done)
    //          Cancelled       Cancelleled by the user account (_qty can be partial)
    //          Reverted        Reverted by MarketPlace due to ni liquidity (_qty can be partial)
    /////////////////////////////////////////////////////////////////////////////////////////
    enum State {
        Unknown,
        Cancelled, // -> Order cancelled by user
        Reverted, // -> Order cancelled by the machine
        Completed, // -> Order completed
        // -> Values under active will be deleted ASAP

        Active, // -> Order active
        Suspended // -> Order pending liquidities
    }

    /*enum OrderExecutionType {
        Unknown,
        Immediat,
        PlaceOrImmediat,
        Place
    }*/
    uint8 constant Reserved = 0x1; // this order doesnt share the item, liquitities, it will be reverted at least, after shared orders, when not enought liquidities
    uint8 constant Hidden = 0x2; // some order props are hidden from public transaction viewer
    uint8 constant Indexed = 0x4; // order is indexedto quote
    uint8 constant Pack = 0x8; // order must be fulfill fully

    struct Info {
        bytes32 fromto; // what you have in stack
        address account; // the user/account/client/customer
        Order.State state; // state of the order
        uint8 options; // this order doesnt share the item, liquitities, it will be reverted at least, after shared orders, when not enought liquidities

        //256bytes
        uint256 orderid; // id of the order

        //256bytes
        uint64 qty; // qty to / you have
        uint64 qtydone; // qty processed / you have left on this order
        uint64 originalqty; // original qty when the order was placed (qty and quote can be ajusted)
        uint64 quote; // current change quote : fromqty * quote = toqty

        uint64 granularity; // qty granularity
        uint64 originalquote; // original quote when the order was placed (qty and quote can be ajusted)
        uint64 originalbasedquote; // original market quote when the order was placed (qty and quote can be ajusted)

    }
    struct InfoPublic {
        address account; // the user/account/client/customer
        bytes32 from;
        bytes32 to;
        //address fromaddr;
        //address toaddr;
        //uint256 fromid;
        //uint256 toid;
        uint256 orderid; // id of the order
        uint256 qty; // active qty
        uint256 granularity; // granularity
        uint256 qtydone; // qty bought or sold
        uint256 originalqty; // original qty when the order was placed (qty and quote can be ajusted)
        uint256 quote; // current quote
        uint256 originalquote; // original quote when the order was placed (qty and quote can be ajusted)
        uint256 originalbasedquote; // original market quote when the order was placed (qty and quote can be ajusted)
        uint256 expire;
        Order.State state; // state of the order
        uint8 options; // order options
    }

    function isExpired(Info memory _order) public pure returns (uint256) {
        return 0;
    }

    function isHidden(uint8 _options) public pure returns (bool) {
        return (_options & Order.Hidden) != 0;
    }

    function isReserved(uint8 _options) public pure returns (bool) {
        return (_options & Order.Reserved) != 0;
    }

    function isIndexed(uint8 _options) public pure returns (bool) {
        return (_options & Order.Indexed) != 0;
    }

    function isPack(uint8 _options) public pure returns (bool) {
        return (_options & Order.Pack) != 0;
    }
}
